                design. It was unique for performance and SEO reasons.
              </p>
            </div>
            <Image
              path="leaksmart/leaksmart-home.png"
              alt="Progressive Home Image"
            />
          </div>
        </div>
      </div>
      <Footer />
    </section>
  );
};

export default Village;
